import { React, useRef, useState, useEffect } from 'react';
import '../asset/health.scss';
import * as d3 from 'd3';
import BarChart from './BarChart';
function Health({ catID, data, mag, annee }) {
  const [nombreFab, setNombreFab] = useState(0);
  const [nombreProd, setNombreProd] = useState(0);
  const [nombreMag, setNombreMag] = useState(0);
  const [moyenneProduit, setMoyenneProduit] = useState(0);
  const [topFab, setTopFab] = useState([]);
  const svgRef = useRef(null);
  const fabData = [];
  const prodData = [];
  const magData = [];
  const prodByFab = [];

  const dateString = [
    'Janvier 2022',
    'Février 2022',
    'Mars 2022',
    'Avril 2022',
    'Mai 2022',
    'Juin 2022',
    'Juillet 2022',
    'Août 2022',
    'Septembre 2022',
    'Octobre 2022',
    'Novembre 2022',
    'Decembre 2022',
    'Janvier 2023',
  ];
  const optionTabs = ['Statistiques', 'Top 10 magasins', 'Moyenne de produit'];
  const currentTab = 'Statistiques';

  useEffect(() => {
    handleData(catID);
  }, [catID, fabData, prodData, magData]);

  useEffect(() => {}, [fabData, prodData, magData]);
  const handleData = (category) => {
    let topMagasin = [];
